func TestKrakenClient_OrderBook(t *testing.T) {
	client := &StubOrderBookClient{}
	krakenClient := KrakenClient{
		client,
	}

	resp := krakenClient.OrderBook(pairs.BTC_USD)

	if resp.Err != nil {
		t.Error("error getting orderbook")
	}

	orderBook := resp.Data

	asks := orderBook.Asks
	bids := orderBook.Bids

	if len(asks) != 100 {
		t.Errorf("number of asks, got: %d, want: %d", len(asks), 100)
	}

	if len(bids) != 100 {
		t.Errorf("number of bids, got: %d, want: %d", len(bids), 100)
	}

	if orderBook.Exchange != exchanges.KRAKEN {
		t.Errorf("name of exchange, got: %d, want: %d", orderBook.Exchange, exchanges.KRAKEN)
	}

	if orderBook.Pair != pairs.BTC_USD {
		t.Errorf("name of pair, got: %d, want: %d", orderBook.Pair, pairs.BTC_USD)
	}
}

