func TestKrakenClient_ChartData(t *testing.T) {
	client := &StubChartDataClient{}
	krakenClient := KrakenClient{
		client,
	}

	resp := krakenClient.ChartData(pairs.BTC_USD, 1*time.Hour, time.Now(), time.Now())

	if resp.Err != nil {
		log15.Error("error getting orderbook")
		return
	}

	candles := resp.Data

	expectedNumOfCandles := 720
	if len(candles) != expectedNumOfCandles {
		t.Errorf("num of candles, got: %d, want: %d", len(candles), expectedNumOfCandles)
	}
}

