func TestKrakenClient_MyTradeHistory(t *testing.T) {
	client := &StubTradeHistoryClient{}
	krakenClient := KrakenClient{client}

	resp := krakenClient.MyTradeHistory()

	if resp.Err != nil {
		t.Error("Error when getting trade history")
	}

	var pairs2 []string

	for pair := range resp.Data {
		pairs2 = append(pairs2, pair)
	}

	correctNumOfPairs := 8

	if len(pairs2) != correctNumOfPairs {
		t.Errorf("Incorrect number of pairs in trade history. got: %d, want: %d", len(pairs2), correctNumOfPairs)
	}
}